// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MilkSupplyChain {
    struct MilkBatch {
        uint id;
        string batchCode;
        string farmName;
        string status; // e.g., "Pending", "Approved", "Completed"
        address owner;
    }

    struct MilkBox {
        uint id;
        uint batchId;
        string serialNumber;
        string status; // e.g., "In Production", "In Transit", "Sold"
        address owner;
    }

    mapping(uint => MilkBatch) public milkBatches;
    mapping(uint => MilkBox) public milkBoxes;

    uint public milkBatchCount;
    uint public milkBoxCount;

    event MilkBatchCreated(uint id, string batchCode, string farmName);
    event MilkBoxCreated(uint id, uint batchId, string serialNumber);
    event StatusUpdated(uint id, string newStatus);

    // Hàm tạo lô sữa
    function createMilkBatch(string memory _batchCode, string memory _farmName) public {
        milkBatchCount++;
        milkBatches[milkBatchCount] = MilkBatch(milkBatchCount, _batchCode, _farmName, "Pending", msg.sender);
        emit MilkBatchCreated(milkBatchCount, _batchCode, _farmName);
    }

    // Hàm tạo hộp sữa
    function createMilkBox(uint _batchId, string memory _serialNumber) public {
        require(milkBatches[_batchId].id != 0, "Milk batch does not exist.");
        milkBoxCount++;
        milkBoxes[milkBoxCount] = MilkBox(milkBoxCount, _batchId, _serialNumber, "In Production", msg.sender);
        emit MilkBoxCreated(milkBoxCount, _batchId, _serialNumber);
    }

    // Hàm cập nhật trạng thái lô sữa
    function updateMilkBatchStatus(uint _id, string memory _newStatus) public {
        require(milkBatches[_id].owner == msg.sender, "Only the owner can update the status.");
        milkBatches[_id].status = _newStatus;
        emit StatusUpdated(_id, _newStatus);
    }

    // Hàm cập nhật trạng thái hộp sữa
    function updateMilkBoxStatus(uint _id, string memory _newStatus) public {
        require(milkBoxes[_id].owner == msg.sender, "Only the owner can update the status.");
        milkBoxes[_id].status = _newStatus;
        emit StatusUpdated(_id, _newStatus);
    }
}
